package org.jzw.yxbs.condition;public class UserInfoCondition extends BaseCondition {		private String username;	private String userInfoid;	private String userInfoval;		public String getUsername() {		return username;	}	public void setUsername(String username) {		this.username = username;	}	public String getUserInfoid() {		return userInfoid;	}	public void setUserInfoid(String userInfoid) {		this.userInfoid = userInfoid;	}	public String getUserInfoval() {		return userInfoval;	}	public void setUserInfoval(String userInfoval) {		this.userInfoval = userInfoval;	}	}